settings.css:
::-webkit-scrollbar {
	visibility: hidden;
}
body { 
	background-color: rgba(0, 0, 0, 0); 
	margin: 0px; 
	overflow: hidden;
}

.chat_line {
	opacity: 1.00 !important;
	line-height: 18px;
	padding:2px 0px 0px;
}
.tag {
    vertical-align: bottom;
    margin-bottom: 0px;
}
#chat_box {
	font-family: "atkinson hyperlegible","source sans pro",sans;
	font-size: 15px;
	//overflow: hidden;
	position: absolute;
	height: auto;
	padding: 2px 1px 0px;
}

